import * as React from 'react';
import Box from '@mui/joy/Box';
import Button from '@mui/joy/Button';


export default function ButtonColors() {

  return (
    <Box
      sx={{
        display: 'flex',
        alignItems: 'center',
        gap: 3,
      }}
    >
      <Box
        sx={{
          display: 'grid',
          gridTemplateColumns: 'repeat(2, minmax(10px, 1fr))',
          gap: 1,
        }}
      >
        <Button size='md' variant={'outlined'} color='primary'>
          Поиск
        </Button>
        <Button size='md' variant={'outlined'} color='danger'>
          Сбросить
        </Button>
      </Box>
    </Box>
  );
}
